import React from 'react';
import './App.css';
import styled from 'styled-components';
import Header from './components/head';
import Footer from './components/foot';
import ItemButtom from './components/itemButton';

const Container = styled.div`

  display:flex;
  color:'black'; 
  background-color:'#F9F9F9'; 
  height:100%;
  width:100%;
  justify-content: center;
  align-items: center;
`;

const Wrapper = styled.div`

  grid-template-columns: repeat(4, minmax(0%, 27%));
  grid-template-rows: repeat(2, minmax(49%, 27%));
  gap:10px;

  height:59%;
  width:65% ;
  overflow:scroll;
  overflow-x: scroll;

`;

function App() {
  return (
    // <div className="App"  style={{display:'flex', backgroundColor:'black', flexDirection:'column', marginBottom:0}}>
      <div style={{display:'flex', flex:1, flexDirection:'column', height:'100%'}}> 
        <Header/>
          <Container>
            <Wrapper style={{ height:"59%", width:"65%", display:'grid', }} >
              <ItemButtom/>
              <div style={{ backgroundColor:'gray', borderColor:'black'}}/>
              <div style={{ backgroundColor:'green', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'yellow', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'purple', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'blue', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'black', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'pink', borderColor:'black', borderWidth:'1px'}}/>              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{ backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>

            </Wrapper>
          </Container>
        <Footer/>
      </div>



    // </div>
  );
}

export default App;
